import React, { useState } from 'react';
import Modal from '../UI/Modal';

const statusOptions = [
  { value: 'incomplete', label: 'Incomplete' },
  { value: 'in_progress', label: 'In Progress' },
  { value: 'completed', label: 'Completed' }
];

const AcknowledgmentModal = ({ open, onClose, onSubmit, task }) => {
  const [description, setDescription] = useState('');
  const [status, setStatus] = useState(task.status);
  const [showStatusSelect, setShowStatusSelect] = useState(false);
  const [error, setError] = useState('');

  const handleAcknowledge = () => {
    if (!description.trim()) {
      setError('Description is required.');
      return;
    }
    setError('');
    setShowStatusSelect(true);
  };

  const handleSubmit = () => {
    if (!description.trim()) {
      setError('Description is required.');
      return;
    }
    onSubmit({ description, status });
    setShowStatusSelect(false);
    setDescription('');
    setStatus(task.status);
  };

  return (
    <Modal open={open} onClose={onClose}>
      <div style={{ padding: 32, minWidth: 340, background: '#fff', borderRadius: 10 }}>
        <h2 style={{ marginBottom: 18, fontSize: 20, fontWeight: 600 }}>Acknowledge Task</h2>
        <div style={{ marginBottom: 18 }}>
          <label style={{ fontWeight: 500 }}>Description</label>
          <textarea
            value={description}
            onChange={e => setDescription(e.target.value)}
            rows={4}
            style={{ width: '100%', marginTop: 8, borderRadius: 6, border: '1px solid #e5e7eb', padding: 10, fontSize: 15 }}
            placeholder="Add your acknowledgment..."
          />
        </div>
        <div style={{ marginBottom: 18 }}>
          <label style={{ fontWeight: 500 }}>Current Status</label>
          <div style={{ marginTop: 8, fontWeight: 600, color: '#007bff', fontSize: 15 }}>{task.status.replace('_', ' ').toUpperCase()}</div>
        </div>
        {error && <div style={{ color: 'red', marginBottom: 8 }}>{error}</div>}
        {!showStatusSelect ? (
          <div style={{ display: 'flex', justifyContent: 'flex-end', gap: 10 }}>
            <button onClick={onClose} style={{ padding: '8px 18px', background: '#f1f5f9', color: '#222', border: 'none', borderRadius: 6, fontWeight: 500 }}>Cancel</button>
            <button 
              onClick={handleAcknowledge} 
              style={{ padding: '8px 18px', background: '#007bff', color: 'white', border: 'none', borderRadius: 6, fontWeight: 500 }}
              disabled={!description.trim()}
            >
              Next: Change Status
            </button>
          </div>
        ) : (
          <>
            <div style={{ marginBottom: 18 }}>
              <label style={{ fontWeight: 500 }}>Change Status</label>
              <select
                value={status}
                onChange={e => setStatus(e.target.value)}
                style={{ width: '100%', marginTop: 8, borderRadius: 6, border: '1px solid #e5e7eb', padding: 10, fontSize: 15 }}
              >
                {statusOptions.map(opt => (
                  <option key={opt.value} value={opt.value}>{opt.label}</option>
                ))}
              </select>
            </div>
            <div style={{ display: 'flex', justifyContent: 'flex-end', gap: 10 }}>
              <button onClick={onClose} style={{ padding: '8px 18px', background: '#f1f5f9', color: '#222', border: 'none', borderRadius: 6, fontWeight: 500 }}>Cancel</button>
              <button onClick={handleSubmit} style={{ padding: '8px 18px', background: '#007bff', color: 'white', border: 'none', borderRadius: 6, fontWeight: 500 }}>Submit</button>
            </div>
          </>
        )}
      </div>
    </Modal>
  );
};

export default AcknowledgmentModal;
